import React from "react";


function User({user}) {
    return (
        <div className="border-solid border-2 p-2 border-emerald-950 m-5">
            <div className="min-w-full h-40"></div>
            <img src={user.avatar} alt="" className="object-cover"/>

            <h3>{user.first_name + " " + user.last_name}</h3>
            <h3>{user.email}</h3>

        </div>

    )
}

export default User;
